import React from "react";
import ReactDOM from "react-dom";
import Heading from "./Heading";
import Par from "./Par";

ReactDOM.render(
  <>
    <Heading />
    <Par />
    <ol>
      <li>Hello</li>
      <li>Hello 2</li>
      <li>Hello 3</li>
      <li>Hello 4</li>
      <li>Hello 5</li>
      <li>Hello 6</li>
      <li>Hello 7</li>
    </ol>
  </>,
  document.getElementById("root")
);
